import React from 'react';
import './App.css';

class App extends React.Component {
  render() {
    return (
      <div className="main">
        <h1>Flip the Switch!</h1>
        <div>
          <button id="on" type="button">On</button>
          <button id="off" type="button">Off</button>
        </div>
        <a class="light">
          <img id="img" src="https://www.freepngimg.com/thumb/light/78179-portable-light-photography-network-incandescent-graphics-bulb.png" alt="light bulb" />
        </a>
      </div>
    );
  }
}

export default App;
